  console.log(
    `Data recived via props:
  title: ${props.title}
  date: ${props.date}
  price: ${props.amount}`
  );


  return (
    <Card className="expense-item">
      <ExpenseDate date={props.date} />
      <div className="expense-item__description">
        <h2>{props.title}</h2>
        <div className="expense-item__price">${props.amount}</div>
      </div>
      <button onClick={() => {}}>change title</button>
    </Card>
  );
};

